import './MidSection.css';
import { imageURL } from '../../../data.js';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
const MidSection = () => {
    return (
        <>
            <Row>
                <div style={{ display: 'flex' }}>
                    {imageURL.map((e) => (
                        <Col lg={4} md={4} xs={2}>
                            <img
                                src={e}
                                alt=""
                                style={{ width: 'auto', height: '200px' }}
                            />
                        </Col>
                    ))}
                </div>
            </Row>
        </>
    );
};

export default MidSection;
